export default data = [
  {
    question: 'Baju adat yang berasal dari Kab. Bone Sulawesi Selatan adalah?',
    options: ['Baju Bodo', 'baju pengantin', 'semua salah', 'semua benar'],
    correct_option: 'Baju Bodo',
  },
  {
    question: 'Pakaian adat yang berasal dari sumatera utara adalah...',
    options: ['Bundo Kanduang', 'Ulos', 'Tongkonan', 'Piyama'],
    correct_option: 'Bundo Kanduang',
  },
  {
    question: 'Aesan Gede merupakan baju adat dari provinsi...',
    options: ['Jawa Timur', 'Sumatera Selatan', 'Jawa Barat', 'Suawesi Utara'],
    correct_option: 'Sumatera Selatan',
  },
  {
    question: 'Teluk Belanga merupakan baju adat dari provinsi...',
    options: ['Gorontalo', 'Papua', 'Kepulauan Riau', 'Semua Salah'],
    correct_option: 'Kepulauan Riau',
  },
  {
    question:
      'Dibawah ini yang merupakan baju adat yang berasal dari bengkulu adalah...',
    options: ['Paksian', 'Baju Kurung', 'Kebaya Encim', 'Baju Betabur'],
    correct_option: 'Baju Betabur',
  },
];
